import React, { useState } from "react";
import "../style/SoundPage.css";

export default function MusicInsights() {
  const [instrumentalness, setInstrumentalness] = useState("");
  const [energy, setEnergy] = useState("");
  const [valence, setValence] = useState("");
  const [liveness, setLiveness] = useState("");
  const [acousticness, setAcousticness] = useState("");
  const [audioFeatureRows, setAudioFeatureRows] = useState([]);
  const [error, setError] = useState("");
  const [loading, setLoading] = useState(false);

  const fetchSongsByAudioFeatures = async () => {
    setLoading(true);
    setError("");
    setAudioFeatureRows([]); // Clear previous results

    try {
      const params = new URLSearchParams({
        instrumentalness,
        energy,
        valence,
        liveness,
        acousticness,
      }).toString();

      const response = await fetch(`http://localhost:8080/songs/audio-features?${params}`);
      if (!response.ok) {
        throw new Error(`Failed to fetch audio features. Status: ${response.status}`);
      }

      const data = await response.json();
      if (Array.isArray(data) && data.length > 0) {
        setAudioFeatureRows(data);
      } else {
        setError("No songs found matching the specified criteria.");
      }
    } catch (err) {
      console.error("Error fetching audio features:", err);
      setError("Failed to fetch songs. Please check your input or try again later.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div id="sound-page-wrapper">
      <h1>Track Explorer</h1>

      <div className="controls">
        <label>Instrumentalness: </label>
        <input
          type="number"
          value={instrumentalness}
          onChange={(e) => setInstrumentalness(e.target.value)}
          step="0.01"
          min="0"
          max="1"
        />
        <label>Energy: </label>
        <input
          type="number"
          value={energy}
          onChange={(e) => setEnergy(e.target.value)}
          step="0.01"
          min="0"
          max="1"
        />
        <label>Valence: </label>
        <input
          type="number"
          value={valence}
          onChange={(e) => setValence(e.target.value)}
          step="0.01"
          min="0"
          max="1"
        />
        <label>Liveness: </label>
        <input
          type="number"
          value={liveness}
          onChange={(e) => setLiveness(e.target.value)}
          step="0.01"
          min="0"
          max="1"
        />
        <label>Acousticness: </label>
        <input
          type="number"
          value={acousticness}
          onChange={(e) => setAcousticness(e.target.value)}
          step="0.01"
          min="0"
          max="1"
        />
        <button onClick={fetchSongsByAudioFeatures}>Search</button>
      </div>

      <div className="results">
        {loading && <div className="loading-message">Loading songs...</div>}
        {error && <div className="error-message">{error}</div>}
        {!loading && !error && audioFeatureRows.length === 0 && (
          <div className="info-message">Enter audio feature values and click search to find songs.</div>
        )}
        {!loading && !error && audioFeatureRows.length > 0 && (
          <table className="data-table">
            <thead>
              <tr>
                <th>Track Title</th>
                <th>Instrumentalness</th>
                <th>Energy</th>
                <th>Valence</th>
                <th>Liveness</th>
                <th>Acousticness</th>
              </tr>
            </thead>
            <tbody>
              {audioFeatureRows.map((row, index) => (
                <tr key={index}>
                  <td>{row.title}</td>
                  <td>{row.instrumentalness !== null ? row.instrumentalness.toFixed(3) : "N/A"}</td>
                  <td>{row.energy !== null ? row.energy.toFixed(3) : "N/A"}</td>
                  <td>{row.valence !== null ? row.valence.toFixed(3) : "N/A"}</td>
                  <td>{row.liveness !== null ? row.liveness.toFixed(3) : "N/A"}</td>
                  <td>{row.acousticness !== null ? row.acousticness.toFixed(3) : "N/A"}</td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>
    </div>
  );
}
